Actionscript.script:
stop();
_root.AreaTextClipF("Bob-Omb Battlefield:"+newline+"<i>(Course #1)</i>", 45);
cannonsetup = false;
_root.warpframe = false;
onEnterFrame = function () {
	if (this.warp1.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 1;
	}
	if (this.warp2.hitTest(_root.Course.Char.charClip.feet) && _root.Course.Char.yspeed<=0) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 2;
	}
	if (warp == true && _root.warpframe == false) {
		if (warpnum == 1) {
			_root.attachMovie("righttransition", "righttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		if (warpnum == 2) {
			_root.attachMovie("uptransition", "uptransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		warp = false;
	}
	if (_root.warpframe == true) {
		if (warpnum == 1) {
			_root.changecourse("righttransition2", "1-2", 200, 0, 0, 0);
		}
		if (warpnum == 2) {
			_root.changecourse("uptransition2", "1-3", -1800+(_root.Course.Char._x-_root.Course.CamEdge._x), -200, -1800+(_root.Course.Char._x-_root.Course.CamEdge._x), 0);
		}
		//_root.warpframe = false;                    
	}
};

onClipEvent (load) {
	_visible = false;
}
onClipEvent (enterFrame) {
	if (this.hitTest(_root.Course.Char.charClip.body) && _root._quality !== "LOW" && _root._quality !== "MEDIUM") {
		if (_root.PauseGame == false && _root.playpause == false) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			if (savezoom == undefined) {
				savezoom = _root.CameraZoom;
			}
			if (_root.CameraZoom>75) {
				_root.CameraZoom -= 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom<savezoom) {
				_root.CameraZoom += 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

onClipEvent (load) {
	invis = true;
	starnum = 4;
	timecount = 0;
	//
	if (_root.Course.coincountnum == undefined) {
		_root.Course.coincountnum = 0;
	} else {
		_root.Course.coincountnum++;
	}
	if (_root["coindata"+_root.playingcourse][0] == undefined) {
		_root["coindata"+_root.playingcourse] = [""];
	}
	coinnum = _root.Course.coincountnum;
	if (_root["coindata"+_root.playingcourse][coinnum] == 1) {
		invis = false;
	}
}
onClipEvent (enterFrame) {
	timecount++;
	if (_root.RedCoins>=8 && timecount>12) {
		_root["coindata"+_root.playingcourse][coinnum] = 1;
		invis = false;
	}
}

onClipEvent (load) {
	DirectionX = "Right";
	DirectionY = "Up";
	distanceX = 0;
	distanceY = 25;
	accelX = 0;
	accelY = 0.5;
	speedX = 0;
	speedY = 3;
}

onClipEvent (load) {
	signmessage = "Jump in the cannon and blast off! (Hint: There's a secret hidden directly upwards)";
}

onClipEvent (load) {
	signmessage = "Look! It's a <i>Water Bottle</i>! Collect it to restore some of your water back.";
}

onClipEvent (load) {
	picture = true;
	signmessage = "1m";
	if (_root.Starnum == 4) {
		signmessage = "1mrc";
	}
}
